import "./App.css";
import React, { Component } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import News from "./components/News";

export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Navbar />
          <Routes>
            <Route
              exact
              path="/"
              element={<News pageSize={9} country="in" category="general" />}
            />
            <Route
              exact
              path="/Business"
              element={<News pageSize={9} country="in" category="Business" />}
            />
            <Route
              exact
              path="/Entertainment"
              element={
                <News pageSize={9} country="in" category="Entertainment" />
              }
            />
            <Route
              exact
              path="/General"
              element={<News key="" pageSize={9} country="in" category="General" />}
            />
            <Route
              exact
              path="/Health"
              element={<News key="Health" pageSize={9} country="in" category="Health" />}
            />
            <Route
              exact
              path="/Science"
              element={<News key="Science" pageSize={9} country="in" category="Science" />}
            />
            <Route
              exact
              path="/Sports"
              element={<News key="Sports" pageSize={9} country="in" category="Sports" />}
            />
            <Route
              exact
              path="/Technology"
              element={<News key="Technology" pageSize={9} country="in" category="Technology" />}
            />
          </Routes>
          act
        </Router>
      </div>
    );
  }
}
